#####################################################################
# CPU2006 kit-1.1, generate 64-bit binary
# Config file for CPU2006
#####################################################################
action = validate
iterations	= 1
output_format	= asc,config
ext         = .exe
tune		= base,peak
PATHSEP		= /
check_md5	= 1
reportable	= 0
ignore_errors	= 1
teeout		= 1
teerunout	= 1
minimize_builddirs = 0
minimize_rundirs= 0
mean_anyway = 1

submit       = echo "$command" > run.sh ; $BIND sh run.sh

use_submit_for_speed	= 1
command_add_redirect	= 1

default=default=default=default:
#####################################################################
#
# Compiler selection
#
#####################################################################
# *** Change these paths ***
CC           = /home/austin/workspace/LLVM_DRAGONEGG/Generic/llvmTip/release_build/bin/clang
CXX          = /home/austin/workspace/LLVM_DRAGONEGG/Generic/llvmTip/release_build/bin/clang++
FC           = /usr/bin/gfortran-4.8

#####################################################################

# *** Change these paths ***
OPTSCHEDCFG=/home/austin/workspace/LLVM_DRAGONEGG/Generic/OptSchedCfg/
DRAGONDIR=/home/austin/workspace/LLVM_DRAGONEGG/Generic/dragonegg/dragonegg.so

# base flags

int=base=default:

#Basic Flags
COPTIMIZE	= -O3 -mllvm -misched=optsched -mllvm -optsched-cfg=$(OPTSCHEDCFG)
CXXOPTIMIZE	= -O3 -mllvm -misched=optsched -mllvm -optsched-cfg=$(OPTSCHEDCFG)

CPORTABILITY = -DSPEC_CPU_LP64

fp=base=default:

#Basic Flags
COPTIMIZE = -O3 -mllvm -misched=optsched -mllvm -optsched-cfg=$(OPTSCHEDCFG)
CXXOPTIMIZE = -O3 -mllvm -misched=optsched -mllvm -optsched-cfg=$(OPTSCHEDCFG)
FOPTIMIZE	= -O3 -fplugin=$(DRAGONDIR) -fplugin-arg-dragonegg-llvm-option=-misched:optsched -fplugin-arg-dragonegg-llvm-option=-optsched-cfg:$(OPTSCHEDCFG)
PORTABILITY = -DSPEC_CPU_LP64


#####################################################################
# Optimization
#####################################################################
## Peak use feedback optimization
default=peak=default:
PASS1_CFLAGS = -fprofile-generate
PASS2_CFLAGS = -fprofile-use
PASS1_CXXFLAGS = -fprofile-generate
PASS2_CXXFLAGS = -fprofile-use
PASS1_FFLAGS = -fprofile-generate
PASS2_FFLAGS = -fprofile-use
PASS1_LDFLAGS = -fprofile-generate
PASS2_LDFLAGS = -fprofile-use

# Peak is high opt
default=peak=default=default:
COPTIMIZE	= -O3 -funroll-all-loops -ffast-math -ftree-vectorize -fvect-cost-model -march=amdfam10
CXXOPTIMIZE	= $[COPTIMIZE]
FOPTIMIZE	= $[COPTIMIZE]

int=peak=default:
CXXOPTIMIZE = -O3 -funroll-all-loops -ffast-math -ftree-vectorize -fvect-cost-model -m64 -march=amdfam10

400.perlbench=peak=default:
#COPTIMIZE	= -O3 -fno-strict-aliasing -funroll-all-loops -ffast-math  -ftree-vectorize -mfpmath=sse -march=amdfam10 -m64
COPTIMIZE	= -O3 -fno-strict-aliasing -mfpmath=sse -march=amdfam10 -m64
PORTABILITY = -DSPEC_CPU_LP64

